import React from "react";
import "./Frame3664.css";

function Frame3664(props) {
  const { contactInformation, wadeGmailCom, className } = props;

  return (
    <div className={`frame-3664 ${className || ""}`}>
      <div className="contact-information ibmplexsans-semi-bold-monsoon-16px">{contactInformation}</div>
      <div className="wadegmailcom ibmplexsans-normal-quarter-spanish-white-16px">{wadeGmailCom}</div>
    </div>
  );
}

export default Frame3664;
